import React from 'react'; 
import './Logo.css';
import sfuLogo from './sfuLogo.png';

const Logo = () => {
	return(
	<div className='ma4 mt0 secret br2 shadow-4' style={{height: 150, width: 150 }}>
		<img className="pa3" style={{display: 'inline-block'}} alt='' src={sfuLogo} />  				
	</div>
)}

export default Logo;
